let valueCount = 1;
let cropId = '52';
let packageId = '45';
let isChecked = "";

function validateIschecked(valueCount , customfieldData, optionName) {
    isChecked = "";
    if(valueCount){
        customfieldData.value[valueCount].map(check=>{
            if(check == optionName){
                isChecked = 'yes';
            }
        })
    }else{
        customfieldData.default_value.map(val=>{
            if(val == optionName){
                isChecked = 'yes';
            }
        })
    }
   return isChecked
    
}
