<div class='crop-form'>
{#each cropJson.preferences.client_profile.questions as cropsData}
	{#if cropId == cropsData.id}
    {#each cropsData.package as packagedata}
    {#if packageId == packagedata.id}
     {#each packagedata.custom_fields as customfieldData}
      {#if customfieldData.field_type == 'D'}
        <div class="fields">
            <div class="fields-name">{customfieldData.help_text}<label>{customfieldData.required ? '*' : ''}</label></div>
            <input class="date-field" type="date" placeholder="Select Date" value="{valueCount ? customfieldData.value[valueCount] : customfieldData.default_value ? customfieldData.default_value: ""}">
            <span data-valmsg-for="crops" data-valmsg-replace="true"></span>
        </div>
       {/if}
       {#if customfieldData.field_type == 'T'}
            {#if customfieldData.help_text.substring(0, 5) == 'NOTES'}
                <div class="fields">
                    <div class="fields-name">{customfieldData.help_text}<label>{customfieldData.required ? '*' : ''}</label></div>
                    <textarea class="text-area-field" rows="4">{valueCount ? customfieldData.value[valueCount] : customfieldData.default_value ? customfieldData.default_value : ""}</textarea>
                    <span data-valmsg-for="crops" data-valmsg-replace="true"></span>
                </div>
            {:else}
               <div class="fields">
                    <div class="fields-name">{customfieldData.help_text}<label>{customfieldData.required ? '*' : ''}</label></div>
                    <input class="text-field" type="text" value="{valueCount ? customfieldData.value[valueCount] : customfieldData.default_value ? customfieldData.default_value : ""}">
                    <span data-valmsg-for="crops" data-valmsg-replace="true"></span>
                </div>
            {/if}
       {/if}
       {#if customfieldData.field_type == 'R'}
            <div class="fields">
                <div class="fields-name">{customfieldData.help_text}<label>{customfieldData.required ? '*' : ''}</label></div>
                <select class="select-field">
                        <option value="{valueCount ? customfieldData.value[valueCount] : customfieldData.default_value ? customfieldData.default_value : ""}" selected disabled hidden>{valueCount ? customfieldData.value[valueCount] : customfieldData.default_value ? customfieldData.default_value : ""}</option>
                    {#each customfieldData.options as option}
                        <option value="{option.name}">{option.name}</option>
                     {/each}
                </select>
                <span data-valmsg-for="crops" data-valmsg-replace="true"></span>
            </div>
       {/if}
       {#if customfieldData.field_type == 'C'}
            <div class="fields">
                <div class="fields-name">{customfieldData.help_text}<label>{customfieldData.required ? '*' : ''}</label></div>
                {#each customfieldData.options as option}
                    <div class="checkbox-field"><input type="checkbox" checked="{validateIschecked(valueCount , customfieldData, option.name)}" name="{option.name}" value="{option.name}">
                    <label for="{option.name}">{option.name}</label><br></div>
                {/each}
                <span data-valmsg-for="Fertilizer" data-valmsg-replace="true"></span>
            </div>
       {/if}
        {#if customfieldData.field_type == 'N'}
            <div class="fields">
                <div class="fields-name">{customfieldData.help_text}<label>{customfieldData.required ? '*' : ''}</label></div>
                <input type="number" value="{valueCount ? customfieldData.value[valueCount] : customfieldData.default_value ? customfieldData.default_value : ""}">
                <span data-valmsg-for="Fertilizer" data-valmsg-replace="true"></span>
            </div>
       {/if}
     
 {/each}
    {/if}
    {/each}
    	{/if}
{/each}
        </div>

